/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `notifications_for_users_trigger` AFTER INSERT ON `notifications_for_users` FOR EACH ROW BEGIN
    DECLARE done INT DEFAULT FALSE;
    DECLARE admin_user_id INT;
    DECLARE admin_cursor CURSOR FOR SELECT id FROM bms.user WHERE User_Type_id IN (1, 4);

    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    IF NEW.message NOT LIKE 'You are assigned%' THEN
        OPEN admin_cursor;
        
        admin_loop: LOOP
            FETCH admin_cursor INTO admin_user_id;
            IF done THEN
                LEAVE admin_loop;
            END IF;
            
            INSERT INTO notifications_for_admin (user_id, project_id, message, admin_id)
            VALUES (NEW.user_id, NEW.project_id, NEW.message, admin_user_id);
        END LOOP;

        CLOSE admin_cursor;
    END IF;
END */;;
DELIMITER ;
